const img = 'data:image/png;base64,';
function createIconImage() {
    const dd = document.getElementById("try");
    const square = document.createElement("div");
    const circle = document.createElement("div");
    const smSquare = document.createElement("div");
    // square.setAttribute('data-html2canvas-ignore','true');
    square.style.cssText = "border: 1px solid gray;width:100%;height:100%;display: flex;justify-content: center;align-items: center;";

    circle.style.cssText='padding: 1%;border: 1px solid gray;border-radius: 50%;width: 60%;height: 60%;display: flex;justify-content: center;align-items: center;';
 
    smSquare.style.cssText = `width: 72%;height: 72%;background: url("${img}") no-repeat center;background-size: 100% 100%;`;

    square.appendChild(circle);
    circle.appendChild(smSquare);
    dd.appendChild(square);
    html2canvas(square).then(function (canvas) {
        console.log(canvas);
        canvas.toBlob((blob) => {
          console.log(blob);
          const elem = window.document.createElement("a");
          elem.href = window.URL.createObjectURL(blob);
          elem.download = "image-download.png";
          document.body.appendChild(elem);
          elem.click();
          document.body.removeChild(elem);
          dd.removeChild(square);
        });
      });
}
